```

73.docs:
Creates a mutable reference to a [`Component`] from a mutable reference to a byte slice. Returns [`None`] if the slice is longer than `MCL`.

Aside from checking the length, this is a cost-free conversion.

#### Examples

```
use willow_data_model::prelude::*;
assert!(Component::<3>::new_mut(&mut [b'y', b'a', b'y']).is_ok());
assert!(Component::<3>::new_mut(&mut [b'n', b'o', b'p', b'e']).is_err());
```

550.docs:
Returns the least path which is strictly greater than `self`, or return `None` if `self` is the greatest possible path.

#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the [`Path`] in bytes, and `m` is the number of [`Component`]s. Performs a single allocation of `O(n + m)` bytes.

#### Examples

```
use willow_data_model::prelude::*;
use order_theory::TrySuccessor;

let p: Path<3, 3, 3> = Path::from_slices(&[
    [255].as_slice(),
    [9, 255].as_slice(),
    [].as_slice(),
])?;
assert_eq!(p.try_successor(), Some(Path::from_slices(&[
    [255].as_slice(),
    [10].as_slice(),
])?));
# Ok::<(), PathError>(())
```

573.docs:
Returns whether `self` and `other` describe equal entries.

# Examples

```
use willow_data_model::prelude::*;

let entry = Entry::builder()
    .namespace_id("family")
    .subspace_id("alfie")
    .path(Path::<4, 4, 4>::new())
    .timestamp(12345)
    .payload_digest("b")
    .payload_length(17)
    .build().unwrap();

assert!(entry.wdm_entry_eq(&entry));

let changed = Entry::prefilled_builder(&entry).timestamp(999999).build().unwrap();
assert!(!entry.wdm_entry_eq(&changed));

```

19.docs:
Turns this builder into an immutable [`Path`].

Panics if the number of [`Component`]s or the total length does not match what was claimed in [`PathBuilder::new`].

#### Complexity

Runs in `O(1)` time. Performs no allocations.

#### Examples

```
use willow_data_model::prelude::*;
let mut builder = PathBuilder::<4, 4, 4>::new(4, 2)?;
builder.append_component(Component::new(b"hi")?);
builder.append_slice(b"ho")?;
assert_eq!(builder.build(), Path::from_slices(&[b"hi", b"ho"])?);
# Ok::<(), PathError>(())
```

446.docs:
Returns the `i`-th [`Component`] of `&self`, without checking whether `i < self.component_count()`.

#### Safety

Undefined behaviour if `i >= self.component_count()`.

#### Complexity

Runs in `O(1)`, performs no allocations.

#### Examples

```
use willow_data_model::prelude::*;
let p: Path<4, 4, 4> = Path::from_slices(&[b"hi", b"ho"])?;
assert_eq!(unsafe { p.component_unchecked(0) }, Component::new(b"hi")?);
assert_eq!(unsafe { p.component_unchecked(1) }, Component::new(b"ho")?);
# Ok::<(), PathError>(())
```

