961.docs:
An [`Area`](https://willowprotocol.org/specs/grouping-entries/#Area) is a box in three-dimensional willow space, consisting of all entries matching either a single subspace id or entries of arbitrary subspace ids, prefixed by some [`Path`], and a [`TimeRange`](super::TimeRange).

Areas are the default way by which application developers should aggregate entries. See [the specification](https://willowprotocol.org/specs/grouping-entries/#areas) for more details.

```
use willow_data_model::prelude::*;

let a1 = Area::<2, 2, 2, u8>::new(None, Path::new(), TimeRange::new_closed(0.into(), 17.into()));

assert!(a1.wdm_includes(&(6, Path::new(), Timestamp::from(9))));
assert_eq!(a1.subspace(), None);

let a2 = Area::<2, 2, 2, u8>::new(Some(42), Path::new(), TimeRange::new_open(15.into()));
assert_eq!(
    a1.wdm_intersection(&a2),
    Ok(Area::<2, 2, 2, u8>::new(
        Some(42),
        Path::new(),
        TimeRange::new_closed(15.into(), 17.into()),
    )),
);
```

[Specification](https://willowprotocol.org/specs/grouping-entries/#Area)

457.docs:
Returns the longest common [prefix](https://willowprotocol.org/specs/data-model/index.html#path_prefix) of `&self` and the given [`Path`].

#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the shorter of the two [`Path`]s, and `m` is the lesser number of [`Component`]s. Performs a single allocation of `O(n + m)` bytes to create the return value.

#### Examples

```
use willow_data_model::prelude::*;
let p1: Path<4, 4, 4> = Path::from_slices(&[b"hi", b"ho"])?;
let p2: Path<4, 4, 4> = Path::from_slices(&[b"hi", b"he"])?;
assert_eq!(p1.longest_common_prefix(&p2), Path::from_slice(b"hi")?);
# Ok::<(), PathError>(())
```

834.docs:
A non-empty [closed range](https://willowprotocol.org/specs/grouping-entries/index.html#closed_range) with an inclusive start value and a strictly-greater exclusive end value.

It includes all values that are greater than or equal to the start value *and* strictly less than the end value.

```
use willow_data_model::prelude::*;

let r = ClosedRange::new(2, 7);
assert_eq!(r.start(), &2);
assert_eq!(r.end(), &7);

assert!(ClosedRange::try_new(7, 2).is_err());
assert!(ClosedRange::try_new(2, 2).is_err());
```

3.docs:
An immutable Willow [Path](https://willowprotocol.org/specs/data-model/index.html#Path). Thread-safe, cheap to clone, cheap to take prefixes of, expensive to append to (linear time complexity).

A Willow Path is any sequence of bytestrings  called [Components](https://willowprotocol.org/specs/data-model/index.html#Component)  fulfilling certain constraints:

- each [`Component`] has a length of at most `MCL` ([**m**ax\_**c**omponent\_**l**ength](https://willowprotocol.org/specs/data-model/index.html#max_component_length)),
- each [`Path`] has at most `MCC` ([**m**ax\_**c**omponent\_**c**ount](https://willowprotocol.org/specs/data-model/index.html#max_component_count)) components, and
- the total size in bytes of all [`Component`]s is at most `MPL` ([**m**ax\_**p**ath\_**l**ength](https://willowprotocol.org/specs/data-model/index.html#max_path_length)).

This type statically enforces these invariants for all (safely) created instances.

Because appending [`Component`]s takes time linear in the length of the full [`Path`], you should not build up [`Path`]s this way. Instead, use [`Path::from_components`], [`Path::from_slices`], [`Path::from_components_iter`], [`Path::from_slices_iter`], or a [`PathBuilder`].

```
use willow_data_model::prelude::*;
let p: Path<4, 4, 4> = Path::from_slices(&[b"hi", b"ho"])?;

assert_eq!(p.component_count(), 2);
assert_eq!(p.component(1), Some(Component::new(b"ho")?));
assert_eq!(p.total_length(), 4);
assert!(p.is_prefixed_by(&Path::from_slice(b"hi")?));
assert_eq!(
    p.longest_common_prefix(&Path::from_slices(&[b"hi", b"he"])?),
    Path::from_slice(b"hi")?
);
# Ok::<(), PathError>(())
```

