571.docs:
Creates a builder which is prefilled with the data from some other entry.

Use this function to create modified copies of entries.

# Examples

```
use willow_data_model::prelude::*;

// Supplying all necessary data yields an entry.
let first_entry = Entry::builder()
    .namespace_id("family")
    .subspace_id("alfie")
    .path(Path::<4, 4, 4>::new())
    .timestamp(12345)
    .payload_digest("some_hash")
    .payload_length(17)
    .build().unwrap();

assert_eq!(*first_entry.wdm_payload_digest(), "some_hash");

let second_entry = Entry::prefilled_builder(&first_entry)
    .timestamp(67890)
    .payload_digest("another_hash")
    .payload_length(4)
    .build().unwrap();

assert_eq!(*second_entry.wdm_payload_digest(), "another_hash");
```

444.docs:
Returns the [`Ordering`] describing the prefix relation between `self` and `other`.

#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the longer [`Path`] in bytes, and `m` is the greatest number of [`Component`]s.

#### Examples

```
use core::cmp::Ordering;
use willow_data_model::prelude::*;
let p: Path<4, 4, 4> = Path::from_slice(b"hi")?;
assert_eq!(p.prefix_cmp(&Path::new()), Some(Ordering::Greater));
assert_eq!(p.prefix_cmp(&Path::from_slice(b"hi")?), Some(Ordering::Equal));
assert_eq!(p.prefix_cmp(&Path::from_slices(&[b"hi", b"ho"])?), Some(Ordering::Less));
assert_eq!(p.prefix_cmp(&Path::from_slice(b"no")?), None);
# Ok::<(), PathError>(())
```

