5.docs:
A helper struct for creating a [`Path`] with exactly one memory allocation. Requires total length and component count to be known in advance.

Enforces that each [`Component`] has a length of at most `MCL` ([**m**ax\_**c**omponent\_**l**ength](https://willowprotocol.org/specs/data-model/index.html#max_component_length)), that each [`Path`] has at most `MCC` ([**m**ax\_**c**omponent\_**c**count](https://willowprotocol.org/specs/data-model/index.html#max_component_count)) [`Component`]s, and that the total size in bytes of all [`Component`]s is at most `MPL` ([**m**ax\_**p**ath\_**l**ength](https://willowprotocol.org/specs/data-model/index.html#max_path_length)).

```
use willow_data_model::prelude::*;
let mut builder = PathBuilder::<4, 4, 4>::new(4, 2)?;
builder.append_component(Component::new(b"hi")?);
builder.append_slice(b"ho")?;
assert_eq!(builder.build(), Path::from_slices(&[b"hi", b"ho"])?);
# Ok::<(), PathError>(())
```

432.docs:
Creates a new [`Path`] by appending a [`Component`] to `&self`.

Creates a fully separate copy of the new data on the heap; which includes cloning all data in `&self`. To efficiently construct [`Path`]s, use [`Path::from_components`], [`Path::from_slices`], [`Path::from_components_iter`], [`Path::from_slices_iter`], or a [`PathBuilder`].

#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the resulting [`Path`] in bytes, and `m` is the number of its [`Component`]s. Performs a single allocation of `O(n + m)` bytes.

#### Examples

```
use willow_data_model::prelude::*;
let p0: Path<4, 4, 4> = Path::new();
let p1 = p0.append_slice(b"hi")?;
let p2 = p1.append_slice(b"!")?;
assert_eq!(
    p2.append_slice(b"no!"),
    Err(PathError::PathTooLong),
);
# Ok::<(), PathError>(())
```

909.docs:
Returns whether the given Willow range is strictly included in `self`.

```
use willow_data_model::prelude::*;

let r = WillowRange::new_closed(2, 7);
assert!(r.strictly_includes_willow_range(&WillowRange::new_closed(2, 6)));
assert!(r.strictly_includes_willow_range(&WillowRange::new_closed(3, 7)));
assert!(r.strictly_includes_willow_range(&WillowRange::new_closed(3, 6)));
assert!(!r.strictly_includes_willow_range(&WillowRange::new_closed(2, 7)));
assert!(!r.strictly_includes_willow_range(&WillowRange::new_closed(1, 7)));
assert!(!r.strictly_includes_willow_range(&WillowRange::new_closed(2, 8)));
assert!(!r.strictly_includes_willow_range(&WillowRange::new_closed(9, 14)));
assert!(!r.strictly_includes_willow_range(&WillowRange::new_open(2)));
```

455.docs:
Creates a new [`Path`] that consists of the first `component_count` [`Component`]s of `&self`. More efficient than creating a new [`Path`] from scratch.

#### Safety

Undefined behaviour if `component_count` is greater than `self.component_count()`. May manifest directly, or at any later
function invocation that operates on the resulting [`Path`].

#### Complexity

Runs in `O(1)`, performs no allocations.

#### Examples

```
use willow_data_model::prelude::*;
let p: Path<4, 4, 4> = Path::from_slices(&[b"hi", b"ho"])?;
assert_eq!(unsafe { p.create_prefix_unchecked(0) }, Path::new());
assert_eq!(unsafe { p.create_prefix_unchecked(1) }, Path::from_slice(b"hi")?);
assert_eq!(unsafe { p.create_prefix_unchecked(2) }, Path::from_slices(&[b"hi", b"ho"])?);
# Ok::<(), PathError>(())
```

278.docs:
An error arising from trying to construct an invalid [`Path`].

#### Examples

```
use willow_data_model::prelude::*;
assert_eq!(Path::<4, 4, 2>::from_slice(b"oops"), Err(PathError::PathTooLong));
assert_eq!(Path::<2, 2, 9>::from_slices(&[b"", b"", b""]), Err(PathError::TooManyComponents));
assert_eq!(Path::<4, 4, 9>::from_slice(b"oopsie"), Err(PathError::ComponentTooLong));
```

655.docs:
Compares `self` to another entry by [timestamp](https://willowprotocol.org/specs/data-model/index.html#entry_timestamp), [payload_digest](https://willowprotocol.org/specs/data-model/index.html#entry_payload_digest) (in case of a tie), and [payload_length](https://willowprotocol.org/specs/data-model/index.html#entry_payload_length) third (in case of yet another tie). See also [`EntrylikeExt::wdm_is_newer_than`] and [`EntrylikeExt::wdm_is_older_than`].

Comparing recency is primarily important to determine [which entries overwrite each other](https://willowprotocol.org/specs/data-model/index.html#prefix_pruning); the [`EntrylikeExt::wdm_prunes`] method checks for that directly.

# Examples

```
use core::cmp::Ordering;
use willow_data_model::prelude::*;

let entry = Entry::builder()
    .namespace_id("family")
    .subspace_id("alfie")
    .path(Path::<4, 4, 4>::new())
    .timestamp(12345)
    .payload_digest("b")
    .payload_length(17)
    .build().unwrap();

assert_eq!(entry.wdm_cmp_recency(&entry), Ordering::Equal);

let lesser_timestamp = Entry::prefilled_builder(&entry).timestamp(5).build().unwrap();
assert_eq!(entry.wdm_cmp_recency(&lesser_timestamp), Ordering::Greater);

let lesser_digest = Entry::prefilled_builder(&entry).payload_digest("a").build().unwrap();
assert_eq!(entry.wdm_cmp_recency(&lesser_digest), Ordering::Greater);

let lesser_length = Entry::prefilled_builder(&entry).payload_length(0).build().unwrap();
assert_eq!(entry.wdm_cmp_recency(&lesser_length), Ordering::Greater);

let greater_timestamp = Entry::prefilled_builder(&entry).timestamp(999999).build().unwrap();
assert_eq!(entry.wdm_cmp_recency(&greater_timestamp), Ordering::Less);

let greater_digest = Entry::prefilled_builder(&entry).payload_digest("c").build().unwrap();
assert_eq!(entry.wdm_cmp_recency(&greater_digest), Ordering::Less);

let greater_length = Entry::prefilled_builder(&entry).payload_length(99).build().unwrap();
assert_eq!(entry.wdm_cmp_recency(&greater_length), Ordering::Less);
```

[Spec definition](https://willowprotocol.org/specs/data-model/index.html#entry_newer).

428.docs:
Creates a singleton [`Path`], consisting of exactly one [`Component`].

Copies the bytes of the [`Component`] into an owned allocation on the heap.

#### Complexity

Runs in `O(n)`, where `n` is the length of the [`Component`]. Performs a single allocation of `O(n)` bytes.

#### Examples

```
use willow_data_model::prelude::*;
let p = Path::<4, 4, 4>::from_component(Component::new(b"hi!")?)?;
assert_eq!(p.component_count(), 1);

assert_eq!(
    Path::<4, 4, 2>::from_component(Component::new(b"hi!")?),
    Err(PathFromComponentsError::PathTooLong),
);
# Ok::<(), PathError>(())
```

