74.docs:
Creates a mutable reference to a [`Component`] from a mutable reference to a byte slice, without verifying its length.

This is a cost-free conversion.

#### Safety

Supplying a slice of length strictly greater than `MCL` may trigger undefined behavior,
either immediately, or on any subsequent function invocation that operates on the resulting [`Component`].

#### Examples

```
use willow_data_model::prelude::*;
let mut buf = [b'y', b'a', b'y'];
let unchecked_component = unsafe { Component::<3>::new_mut_unchecked(&mut buf[..]) };
assert_eq!(unchecked_component.as_ref(), &mut [b'y', b'a', b'y']);
```

451.docs:
Creates an iterator over the [`Component`]s of `&self`, starting at the `i`-th [`Component`]. If `i` is greater than or equal to the number of [`Component`]s, the iterator yields zero items.

Stepping the iterator takes `O(1)` time and performs no memory allocations.

#### Complexity

Runs in `O(1)`, performs no allocations.

#### Examples

```
use willow_data_model::prelude::*;
let p: Path<4, 4, 4> = Path::from_slices(&[b"hi", b"ho"])?;
let mut comps = p.suffix_components(1);
assert_eq!(comps.next(), Some(Component::new(b"ho")?));
assert_eq!(comps.next(), None);
# Ok::<(), PathError>(())
```

1155.docs:
Returns whether `self` and `other` describe equal coordinates, i.e., whether their [subspace ids](Keylike::wdm_subspace_id), [paths](Keylike::wdm_path), and [timestamps](Coordinatelike::wdm_timestamp) are all equal.

# Examples

```
use willow_data_model::prelude::*;

# #[cfg(feature = "dev")] {///
assert!(
    (Alfie, Path::<4, 4, 4>::new(), 25.into())
    .wdm_coordinate_eq(&(Alfie, Path::<4, 4, 4>::new(), 25.into()))
