570.docs:
Creates a builder for [`Entry`].

# Examples

```
use willow_data_model::prelude::*;

// Supplying incomplete data errors.
assert!(
    Entry::builder()
    .path(Path::<4, 4, 4>::new())
    .namespace_id("family")
    .subspace_id("alfie")
    .payload_digest("some_hash")
    // timestamp and payload_length are missing!
    .build().is_err()
);

// Supplying all necessary data yields an entry.
let entry = Entry::builder()
    .namespace_id("family")
    .subspace_id("alfie")
    .path(Path::<4, 4, 4>::new())
    .timestamp(12345)
    .payload_digest("some_hash")
    .payload_length(17)
    .build().unwrap();

assert_eq!(*entry.wdm_subspace_id(), "alfie");
```

897.docs:
Converts this range into a different range by applying a function to all endpoints, without checking if the resulting range would be empty.

## Safety

Undefined behaviour may occur if the resulting range would be empty.

```
use willow_data_model::prelude::*;

assert_eq!(
    unsafe {
        WillowRange::<u8>::new_closed(3, 8).map_unchecked(|x| (x + 1) as u16)
    },
    WillowRange::<u16>::new_closed(4, 9),
);
```

443.docs:
Tests whether `&self` is [related](https://willowprotocol.org/specs/data-model/index.html#path_related) to the given [`Path`], that is, whether either one is a [prefix](https://willowprotocol.org/specs/data-model/index.html#path_prefix) of the other.

#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the longer [`Path`] in bytes, and `m` is the greatest number of [`Component`]s.

#### Examples

```
use willow_data_model::prelude::*;
let p: Path<4, 4, 4> = Path::from_slice(b"hi")?;
assert!(p.is_related_to(&Path::new()));
assert!(p.is_related_to(&Path::from_slice(b"hi")?));
assert!(p.is_related_to(&Path::from_slices(&[b"hi", b"ho"])?));
assert!(!p.is_related_to(&Path::from_slices(&[b"no"])?));
# Ok::<(), PathError>(())
```

