1220.docs:
Converts self into an [`AuthorisedEntry`], without checking if `self.authorisation_token` [authorise](https://willowprotocol.org/specs/data-model/index.html#is_authorised_write) `self.entry`.

```
# #[cfg(feature = "dev")] {
use willow_data_model::prelude::*;
use willow_data_model::test_parameters::*;

let entry = Entry::builder()
    .namespace_id(Family)
    .subspace_id(Alfie)
    .path(Path::<4, 4, 4>::new())
    .timestamp(12345)
    .payload_digest(Spades)
    .payload_length(2)
    .build().unwrap();

let pae = PossiblyAuthorisedEntry {
    entry: entry.clone(),
    authorisation_token: TestSubspaceSignature::new_for_entry(&entry, &AlfieSecret).unwrap(),
};
let authed = unsafe { pae.into_authorised_entry_unchecked() };
assert_eq!(authed.entry(), &entry);
assert_eq!(authed.authorisation_token(), &AlfieSignature);
# }
```

#### Safety

Undefined behaviour may occur if `self.authorisation_token.does_authorise(&self.entry)` is `false`. If it returns `true`, this method is safe to call.

162.docs:
Creates an [`OwnedComponent`] by copying data from a byte slice. Returns [`None`] if the slice is longer than `MCL`.

#### Complexity

Runs in `O(n)`, where `n` is the length of the slice. Performs a single allocation of `O(n)` bytes.

#### Examples

```
use willow_data_model::prelude::*;
assert!(OwnedComponent::<3>::new(b"yay").is_ok());
assert!(OwnedComponent::<3>::new(b"too_long").is_err());
```

539.docs:
Creates the greatest possible [`Path`] (with respect to lexicographical ordering, which is also the [`Ord`] implementation of [`Path`]).

#### Complexity

Runs in `O(MCC + MPL)`. Performs a single allocation of `O(MPL)` bytes.

#### Examples

```
use willow_data_model::prelude::*;
use order_theory::GreatestElement;

let p = Path::<4, 4, 4>::greatest();
assert_eq!(p.component_count(), 4);
assert_eq!(p.component(0).unwrap().as_ref(), &[255, 255, 255, 255]);
assert!(p.component(1).unwrap().is_empty());
assert!(p.component(2).unwrap().is_empty());
assert!(p.component(3).unwrap().is_empty());
```

