assert_eq!(p.create_suffix(1), Some(Path::from_slices(&[b"ho"])?));
assert_eq!(p.create_suffix(2), Some(Path::from_slices(&[b"hi", b"ho"])?));
assert_eq!(p.create_suffix(3), None);

# Ok::<(), PathError>(())
```

