962.docs:
An arbitrary box in three-dimensional willow space, consisting of a [`SubspaceRange`](super::SubspaceRange), a [`PathRange`](super::PathRange), and a [`TimeRange`](super::TimeRange).

As an application developer, you probably do not need to interact with 3d ranges, you should prefer [`Areas`](super::Area)  the latter work well with encrypted data, whereas 3d ranges do not define human-meaningful subsets of data when working with encryption.

```
use willow_data_model::prelude::*;

# #[cfg(feature = "dev")] {
let r = Range3d::<4, 4, 4, TestSubspace>::new(
    SubspaceRange::new_open(Betty),
    PathRange::full(),
    TimeRange::new_closed(0.into(), 17.into())
);

assert!(r.wdm_includes(&(Gemma, Path::new(), Timestamp::from(9))));
assert_eq!(r.subspaces(), &SubspaceRange::new_open(Betty));

let r2 = Range3d::<4, 4, 4, TestSubspace>::new(
    SubspaceRange::new_closed(Alfie, Dalton),
    PathRange::full(),
    TimeRange::new_open(15.into()),
);
assert_eq!(
    r.wdm_intersection(&r2),
    Ok(Range3d::<4, 4, 4, TestSubspace>::new(
        SubspaceRange::new_closed(Betty, Dalton),
        PathRange::full(),
        TimeRange::new_closed(15.into(), 17.into()),
    )),
);
# }
```

[Specification](https://willowprotocol.org/specs/grouping-entries/index.html#D3Range)

458.docs:
Creates a [`Path`] whose [`Component`]s are those of `&self` indexed by the given `range`, without checking that those components exist.

#### Safety

Undefined behaviour if either the start or the end of `range` are explicitly greater than `self.component_count()`, or if `range` is decreasing.

#### Complexity

Runs in `O(1)` and performs no allocations.

#### Examples

```
use willow_data_model::prelude::*;
let p: Path<4, 4, 4> = Path::from_slices(&[b"hi", b"ho"])?;
assert_eq!(unsafe{p.create_slice_unchecked(..)}, p);
assert_eq!(unsafe{p.create_slice_unchecked(..1)}, Path::from_slices(&[b"hi"])?);
assert_eq!(unsafe{p.create_slice_unchecked(1..)}, Path::from_slices(&[b"ho"])?);
assert_eq!(unsafe{p.create_slice_unchecked(1..1)}, Path::new());
# Ok::<(), PathError>(())
```

431.docs:
Creates a new [`Path`] by appending a [`Component`] to `&self`.

Creates a fully separate copy of the new data on the heap; which includes cloning all data in `&self`. To efficiently construct [`Path`]s, use [`Path::from_components`], [`Path::from_slices`], [`Path::from_components_iter`], [`Path::from_slices_iter`], or a [`PathBuilder`].

#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the resulting [`Path`] in bytes, and `m` is the number of its [`Component`]s. Performs a single allocation of `O(n + m)` bytes.

#### Examples

```
use willow_data_model::prelude::*;
let p0: Path<4, 4, 4> = Path::new();
let p1 = p0.append_component(Component::new(b"hi")?)?;
let p2 = p1.append_component(Component::new(b"!")?)?;
assert_eq!(
    p2.append_component(Component::new(b"no!")?),
    Err(PathFromComponentsError::PathTooLong),
);
# Ok::<(), PathError>(())
```

908.docs:
Returns whether the given Willow range is included in `self`.

```
use willow_data_model::prelude::*;

let r = WillowRange::new_closed(2, 7);
assert!(r.includes_willow_range(&WillowRange::new_closed(2, 7)));
assert!(!r.includes_willow_range(&WillowRange::new_closed(1, 7)));
assert!(!r.includes_willow_range(&WillowRange::new_closed(2, 8)));
assert!(!r.includes_willow_range(&WillowRange::new_closed(9, 14)));
assert!(!r.includes_willow_range(&WillowRange::new_open(2)));
```

